import React from 'react';
import '../style/index.css';
import MainAccueil from '../components/mainAccueil'
import DarkModeToggle from './DarkModeToggle';

const Accueil = () => {
    return (
        <main className='accueil'>
            <MainAccueil />
            <DarkModeToggle />
        </main>
    );
};
export default Accueil;
